// O node anterior se chama "Juntando dados", então os dados estão em $json
const leadData = $json.lead;
const localData = $json.local;

// --- DADOS DE ENTRADA ---
const eventDateString = localData.data;
const registrationDateString = leadData.created_at;

// --- LÓGICA DO CÓDIGO ---
const eventTimestamp = new Date(eventDateString).getTime();
const registrationTimestamp = new Date(registrationDateString).getTime();
const nowTimestamp = $now.toMillis(); // Usando $now do n8n para precisão

const twoHoursMs = 7200000;
const oneDayMs = 86400000;

// Variáveis para armazenar o resultado final
let status = "Nenhum Gatilho Ativo";
let campoDB = null; // Começa como nulo

const isInWindow = (windowStart) => {
  const windowEnd = windowStart + twoHoursMs;
  return nowTimestamp >= windowStart && nowTimestamp < windowEnd;
};

// --- VERIFICAÇÕES ---

// 1. Pós-Inscrição
// MODIFICADO: Checa se a coluna JSONB é nula em vez de booleana
if (isInWindow(registrationTimestamp + oneDayMs) && leadData.disp_dia_pos_inscricao == null) {
  status = "Pós-Inscrição";
  campoDB = "disp_dia_pos_inscricao";
}
// 2. Pré-Evento
else {
  if (isInWindow(eventTimestamp - (30 * oneDayMs)) && leadData.disp_30_dias_antes == null) {
    status = "Faltam 30 dias";
    campoDB = "disp_30_dias_antes";
  }
  else if (isInWindow(eventTimestamp - (7 * oneDayMs)) && leadData.disp_1_semana_antes == null) {
    status = "Falta 1 semana";
    campoDB = "disp_1_semana_antes";
  }
  else if (isInWindow(eventTimestamp - (3 * oneDayMs)) && leadData.disp_3_dias_antes == null) {
    status = "Faltam 3 dias";
    campoDB = "disp_3_dias_antes";
  }
  else if (isInWindow(eventTimestamp - (1 * oneDayMs)) && leadData.disp_1_dia_antes == null) {
    status = "É Amanhã";
    campoDB = "disp_1_dia_antes";
  }
  else if (isInWindow(eventTimestamp) && leadData.disp_dia_evento == null) {
    status = "É Hoje";
    campoDB = "disp_dia_evento";
  }
}

// Retorna o status e o nome do campo correspondente
return { 
  status: status,
  campoDB: campoDB
};

