// Pega o item que chega no nó.
// Assumimos que o texto CSV está num campo chamado 'textoCsv' no item anterior.
const csvTexto = $input.first().json.data

// Quebra o texto em linhas, removendo espaços em branco no início/fim.
const linhas = csvTexto.trim().split('\n');

// Pega a primeira linha (cabeçalho) e quebra pelas vírgulas para ter os nomes das chaves.
const cabecalho = linhas[0].split(',');

// Pega todas as outras linhas (os dados).
const linhasDeDados = linhas.slice(1);

// Mapeia cada linha de dados para um objeto JSON.
const resultadoJson = linhasDeDados.map(linha => {
  const valores = linha.split(',');

  // Usa 'reduce' para construir o objeto dinamicamente.
  // Para cada item do cabeçalho, cria uma chave no objeto com o valor correspondente.
  return cabecalho.reduce((objeto, chave, index) => {
    objeto[chave.trim()] = valores[index].trim();
    return objeto;
  }, {});
});

// Retorna o array de objetos JSON.
// Este será o output do nó Code e poderá ser usado nos próximos nós.
return resultadoJson;
